import React from 'react';
import { NavLink } from 'react-router-dom';
import './UsersCRUD.css'; // Importa el archivo CSS para los estilos

function UsersCRUD() {
  return (
    <div className="users-container">
      <div className="banner">ClonBuster: Usuarios</div>
      <div className="buttons-column">
      <NavLink to="create" className="action-button">Crear</NavLink>
      <NavLink to="/readUsers/" className="action-button">Leer</NavLink>
      <NavLink to="/update" className="action-button">Actualizar</NavLink>
      <NavLink to="/delete" className="action-button">Borrar</NavLink>
      <NavLink to="/" className="return-button">Regresar</NavLink>
      </div>
    </div>
  );
}

export default UsersCRUD;
